<?php

namespace MediaSeekerTest;

use MediaSeeker\FileSystem\FileSystem;
use MediaSeeker\MediaSeeker;
use MediaSeeker\Models\Media;
use org\bovigo\vfs\vfsStream;
use org\bovigo\vfs\vfsStreamFile;
use PHPUnit\Framework\TestCase;

class MediaSeekerTest extends TestCase
{
    /** @var  vfsStreamFile */
    private $imageFile;

    private $root;

    public function setUp()
    {
        $this->root = vfsStream::setup();
        $this->imageFile = vfsStream::newFile('image.jpg')
            ->withContent(base64_decode(''))
            ->lastModified(strtotime('2015'))
            ->at($this->root);
    }

    public function testMediaFileIsCreatedWithRightDate()
    {
        file_put_contents('d:\\photo.jpg', file_get_contents($this->imageFile->url()));

        $seeker = new MediaSeeker(new FileSystem());
        //$this->assertInstanceOf(Media::class, $seeker->readFileInfo($this->imageFile->url()));
        $this->assertTrue(true);
    }
}